import React, { Component } from 'react'

export class ProfilePictureUpload extends Component {
    render() {
        return (
            <div>
                <div>
                <input type="file"
                    onChange={this.fileSelectHandler}
                />
                </div>
                <button
                    type="submit"
                    className="btn btn-primary"
                >
                Upload
                </button>
            </div>
        )
    }
}

export default ProfilePictureUpload
